import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

// ダミーページコンポーネント
const Subscription = () => <div style={{padding: '2em'}}><h2>サブスクページ</h2><p>ここにサブスクの内容が入ります。</p></div>;
const AllProducts = () => <div style={{padding: '2em'}}><h2>商品一覧ページ</h2><p>ここに商品一覧が入ります。</p></div>;
const Influencer = () => <div style={{padding: '2em'}}><h2>インフルエンサーコラボページ</h2><p>ここにコラボ内容が入ります。</p></div>;
const Patchwork = () => <div style={{padding: '2em'}}><h2>よりそいクラフトページ</h2><p>ここにクラフト内容が入ります。</p></div>;

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/subscription" element={<Subscription />} />
        <Route path="/all-products" element={<AllProducts />} />
        <Route path="/influencer_subscription" element={<Influencer />} />
        <Route path="/patchwork_kit_website" element={<Patchwork />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
